  String? // Added missing field\n  isVerified          Boolean @default(false)\n  isPromoted          Boolean @default(false)\n  rating              Float   @default(0)\n  totalReviews        Int     @default(0)\n  deliveryTime        String?\n  isOpen              Boolean @default(true)\n\n  // Common fields\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  products     Product[]\n  sellerOrders SellerOrder[]\n}\n\n// Delivery Agent table\nmodel DeliveryAgent {\n  id          Int     @id @default(autoincrement())\n  name        String\n  email       String  @unique\n  phone       String?\n  countryCode String  @default(\"+91\")\n  password    String\n  avatar      String?\n\n  // Delivery specific fields\n  vehicleNumber   String\n  vehicleType     String\n  isAvailable     Boolean @default(true)\n  currentLocation String?\n\n  // Common fields\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  deliveryOrders Order[] @relation(\"DeliveryAgent\")\n}\n\n// Product table for sellers\nmodel Product {\n  id            Int     @id @default(autoincrement())\n  name          String\n  description   String?\n  price         Float\n  originalPrice Float?\n  image         String?\n  category      String?\n  subcategory   String?\n  stock         Int     @default(0)\n  inStock       Boolean @default(true)\n  isActive      Boolean @default(true)\n\n  // Seller relation\n  sellerId Int\n  seller   Seller @relation(fields: [sellerId], references: [id], onDelete: Cascade)\n\n  // Timestamps\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  orderItems OrderItem[]\n}\n\n// Order table for customer orders\nmodel Order {\n  id          Int    @id @default(autoincrement())\n  orderNumber String @unique\n\n  // Customer who placed the order\n  customerId Int\n  customer   Customer @relation(fields: [customerId], references: [id])\n\n  // Delivery agent assigned to the order\n  deliveryAgentId Int?\n  deliveryAgent   DeliveryAgent? @relation(\"DeliveryAgent\", fields: [deliveryAgentId], references: [id])\n\n  // Order details\n  items       OrderItem[]\n  orderStatus OrderStatus @default(PENDING)\n\n  // Customer details\n  customerName     String\n  customerPhone    String\n  customerAddress  String\n  customerCity     String\n  customerArea     String\n  customerLocality String?\n\n  // Amount details\n  subtotal    Float\n  deliveryFee Float\n  taxAmount   Float @default(0)\n  totalAmount Float\n\n  // Payment details\n  paymentMethod PaymentMethod\n  paymentStatus PaymentStatus @default(PENDING)\n\n  // Delivery details\n  deliveryInstructions  String?\n  estimatedDeliveryTime DateTime?\n  actualDeliveryTime    DateTime?\n\n  // Timestamps\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  sellerOrders SellerOrder[]\n  payments     Payment[]\n  tracking     OrderTracking[]\n}\n\n// Order items within an order\nmodel OrderItem {\n  id Int @id @default(autoincrement())\n\n  // Order relation\n  orderId Int\n  order   Order @relation(fields: [orderId], references: [id], onDelete: Cascade)\n\n  // Product relation\n  productId Int\n  product   Product @relation(fields: [productId], references: [id])\n\n  // Item details\n  quantity   Int\n  unitPrice  Float\n  totalPrice Float\n\n  // Product snapshot (in case product gets deleted/modified)\n  productName     String\n  productImage    String?\n  productCategory String?\n}\n\n// Seller Orders table to track orders for each seller\nmodel SellerOrder {\n  id Int @id @default(autoincrement())\n\n  // Order relation\n  orderId Int\n  order   Order @relation(fields: [orderId], references: [id], onDelete: Cascade)\n\n  // Seller relation\n  sellerId Int\n  seller   Seller @relation(fields: [sellerId], references: [id])\n\n  // Seller order status\n  status OrderStatus @default(PENDING)\n\n  // Seller specific details\n  items      Json // Array of order items for this seller\n  subtotal   Float\n  commission Float @default(0)\n  netAmount  Float\n\n  // Timestamps\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([orderId, sellerId])\n}\n\n// Payment table to track all payments\nmodel Payment {\n  id        Int    @id @default(autoincrement())\n  paymentId String @unique\n\n  // Order relation\n  orderId Int\n  order   Order @relation(fields: [orderId], references: [id])\n\n  // Customer relation (who made the payment)\n  customerId Int\n  customer   Customer @relation(fields: [customerId], references: [id])\n\n  // Payment details\n  amount        Float\n  paymentMethod PaymentMethod\n  paymentStatus PaymentStatus @default(PENDING)\n\n  // Transaction details\n  transactionId   String?\n  gateway         String?\n  gatewayResponse Json?\n\n  // Timestamps\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\n// Order tracking for real-time updates\nmodel OrderTracking {\n  id          Int            @id @default(autoincrement())\n  orderId     Int\n  order       Order          @relation(fields: [orderId], references: [id], onDelete: Cascade)\n  status      TrackingStatus\n  description String\n  location    String?\n  createdAt   DateTime       @default(now())\n\n  @@index([orderId])\n}\n\n// Chat messages for customer-seller communication\nmodel ChatMessage {\n  id           Int      @id @default(autoincrement())\n  senderId     String // Can be customer or seller ID\n  senderType   String // \"customer\" or \"seller\"\n  receiverId   String // Can be customer or seller ID\n  receiverType String // \"customer\" or \"seller\"\n  message      String\n  orderId      Int? // Optional: link to specific order\n  isRead       Boolean  @default(false)\n  createdAt    DateTime @default(now())\n  updatedAt    DateTime @updatedAt\n}\n",
